import { Text, View, StyleSheet } from "react-native";

function PrimaryButton({children}) {
    return (
        <View style={styles.inputContainer}> 
            <Text>{children}</Text>
        </View>
    )
}

export default PrimaryButton;

const styles =  StyleSheet.create({
    inputContainer: {
        flex: 1,
        marginTop: 100,
        padding: 16,
    }
});
